import React from 'react';
import classes from './Input.module.css';

const input =(props) =>{
    let inputElement=null;
   switch(props.elemetnType)
   {
       case ('input'):
            inputElement=<input className={classes.InputElement} {...props.elemetnType}/>
            break;
        case ('textarea'):
                inputElement=<textarea className={classes.InputElement} {...props.elemetnType}/>
                break;
        default: 
        inputElement=<input className={classes.InputElement} {...props.elemetnType}/>
   }
   
    return(
    <div className={classes.Input}>
        <label className={classes.Label}>{props.label}</label>
        {inputElement}
        
    </div>
);
};

export default input;
